import React from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const Header = () => {
    return (
        <div className="bg-gray-800 text-white py-4 px-8 flex justify-between items-center">
          <div className="flex-grow text-center">
            <span className="text-xl font-semibold"><h1>Books Club Web</h1></span>
          </div>
          <div className="flex justify-end items-center">
            {/* ... other content ... */}
            <Link to="/signup" className="button-style mr-4">Sign Up</Link>
            <Link to="/signin" className="button-style mr-4">Sign In</Link>
            <Link to="/about" className="button-style mr-4">About</Link>
            <Link to="/contact" className="button-style">Contact Us</Link>
          </div>
        </div>
      );
};

export default Header;
